function getJml($conn, $kodedagri)
{
    $jml = 0;
    $sql = "select jml from ternak where kodedagri='$kodedagri'";
    $hasil = mysqli_query($conn, $sql);
    $data = mysqli_fetch_array($hasil);
    if ($data) {
        $jml = $data['jml'];
    }
    return $jml;
}
